import React from "react";
import './StyleUserPhoto.css'

const UserPhoto = ()=>{
    let img : string = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTuvGo9ecVjgp7kZvQ2qsmmKN00ptRKjVLy1w&usqp=CAU";
    return <div>
        <img className="userPhoto" src={img} />
    </div>
}

export default UserPhoto;
